	public static int lengthOfLongestSubstring(String string) {

		if (string.length() == 0)
			return 0;

		int ans = 1, pointer = 0;

		char curr = string.charAt(0);

		Map<Character, Integer> hm = new LinkedHashMap<Character, Integer>();

		hm.put(string.charAt(0), 0);

		for (int i = 1; i < string.length(); i++) {

			curr = string.charAt(i);

			if (hm.containsKey(curr) && hm.get(curr) >= pointer) {
				pointer = hm.get(curr) + 1;
			}
			hm.put(curr, i);

			ans = Math.max(ans, i - pointer + 1);
			// System.out.printf("i = %s %s, ans = %s, pointer = %s, hm = %s \n", i, curr,
			// ans, pointer, hm);
		}

		return ans;
	}

